import { Component } from 'react';
import './App.css';
import Logo from './Comp/Logo';
import Navi from './Comp/Navi';
import SrchBar from './Comp/SrchBar';
import Card from './Comp/Card';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      location: '',
      cuisine: '',
      route: 'home',
      res: [],
    };
  }

  onChange = (event) => {
    this.setState({ cuisine: event.target.value });
  };

  render() {
    return (
      <div className="App">
        <div>
          <Logo />
          <Navi />
        </div>
        <h1> Yelp</h1>

        <SrchBar />
        <div className="card">
          <Card />
          <Card />
          <Card />
        </div>
      </div>
    );
  }
}

export default App;
